import * as React from 'react';
import { Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';

function HomeScreen() {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Home!</Text>
    </View>
  );
}

function SettingsScreen() {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Settings!</Text>
    </View>
  );
}

const Tab = createMaterialTopTabNavigator();

export default function OrderScreen() {
  return (
    <Tab.Navigator
      tabBarOptions={{
        scrollEnabled: true
      }}
      screenOptions={{
        tabBarItemStyle: { width: 130 },
        tabBarStyle: { backgroundColor: '#99ccff' },
      }}
    >
      <Tab.Screen name="Tất cả đơn" component={HomeScreen} />
      <Tab.Screen name="Chờ giao hàng" component={SettingsScreen} />
      <Tab.Screen name="Đang giao hàng" component={SettingsScreen} />
      <Tab.Screen name="Đã giao hàng" component={SettingsScreen} />
      <Tab.Screen name="Đơn hủy" component={SettingsScreen} />
    </Tab.Navigator>
  );
}
